import React,{ useEffect,useState } from 'react'
import axios from "axios"
export default function FiltterPage() {
  const [ data,setData ] = useState([])
  useEffect(() => {
    const fetchData = async()=>{
      try{
        const res = await axios.get("../data.json")
        setData(res)
      }
      catch(error){
        console.log(error)
      }
    }
  }, [data])
  
  return (
    <div>FiltterPage</div>
  )
}
